datastream = ""


def getFirstMarker(ds):
    #start-of-packet size
    size = 14
    for i in range(0,len(ds)-size):
        found = False
        for z in ds[i:i+size]:
            if not found and ds[i:i+size].replace(z,"",1).count(z)>0:
                found = True
        if not found:
            return i+size

        


print(getFirstMarker(datastream))